import { setExampleData } from "../Data/list";
import { CalculateMonthAvarge } from "./Analyse/calculateMonth";
import { CalculateChartData } from "./DataFunctions/ChartData";
import { GetData } from "./DataFunctions/Datadealer";

export function Initialization(){
    // get data
    var storageData = GetData()

    // add data for "welcome"
    var date = new Date()
    if (storageData === "no data"){
        storageData = [{id: 0, state: "Initialization", date: {day: date.getDate(), month: date.getMonth() + 1, year: 2023}, amount: 0, bankBalance:0},
                        {id: 1, state: "Einkommen", date: {day: date.getDate(), month: date.getMonth() + 1, year: 2023}, amount: 1, bankBalance:1},
                        {id: 2, state: "Ausgaben", date: {day: date.getDate(), month: date.getMonth() + 1, year: 2023}, amount: 1, bankBalance:0}]
    }
    

    setExampleData(storageData)

    //calculate
    CalculateMonthAvarge()
    CalculateChartData()
}
